import React, { Component } from "react";

import "./Graella.css";

/*let img = [
  "foto1.jpg",
  "foto2.jpg",
  "foto3.jpg",
  "foto4.jpg",
  "foto5.jpg",
  "foto6.jpg",
  "foto7.jpg",
  "foto8.jpg",
];*/
let i = 0;
class Graella extends Component {
  constructor(props) {
    super(props);

    this.funcionZoom = this.funcionZoom.bind()(this);
  }

  funcionZoom() {
    // Asigna los datos originales de altura y anchura
    if (i === 0) {
      i = i + 1;
      if (document.getElementById("foto1")) {
        document.getElementById("foto1").height = "400px";
        document.getElementById("foto1").width = "400px";
      } else {
        document.getElementById("foto1").height = "100px";
        document.getElementById("foto1").width = "100px";
      }
      if (document.getElementById("foto2")) {
        document.getElementById("foto2").height = "400px";
        document.getElementById("foto2").width = "400px";
      } else {
        document.getElementById("foto2").height = "100px";
        document.getElementById("foto2").width = "100px";
      }
      if (document.getElementById("foto3")) {
        document.getElementById("foto3").height = "400px";
        document.getElementById("foto3").width = "400px";
      } else {
        document.getElementById("foto3").height = "100px";
        document.getElementById("foto3").width = "100px";
      }
      if (document.getElementById("foto4")) {
        document.getElementById("foto4").height = "400px";
        document.getElementById("foto4").width = "400px";
      } else {
        document.getElementById("foto4").height = "100px";
        document.getElementById("foto4").width = "100px";
      }
      if (document.getElementById("foto5")) {
        document.getElementById("foto5").height = "400px";
        document.getElementById("foto5").width = "400px";
      } else {
        document.getElementById("foto5").height = "100px";
        document.getElementById("foto5").width = "100px";
      }
      if (document.getElementById("foto6")) {
        document.getElementById("foto6").height = "400px";
        document.getElementById("foto6").width = "400px";
      } else {
        document.getElementById("foto6").height = "100px";
        document.getElementById("foto6").width = "100px";
      }
      if (document.getElementById("foto7")) {
        document.getElementById("foto7").height = "400px";
        document.getElementById("foto7").width = "400px";
      } else {
        document.getElementById("foto7").height = "100px";
        document.getElementById("foto7").width = "100px";
      }
      if (document.getElementById("foto8")) {
        document.getElementById("foto8").height = "400px";
        document.getElementById("foto8").width = "400px";
      } else {
        document.getElementById("foto8").height = "100px";
        document.getElementById("foto8").width = "100px";
      }
    } else {
      i = 0;
      if (document.getElementById("foto1")) {
        document.getElementById("foto1").height = "100px";
        document.getElementById("foto1").width = "100px";
      }
      if (document.getElementById("foto2")) {
        document.getElementById("foto2").height = "100px";
        document.getElementById("foto2").width = "100px";
      }
      if (document.getElementById("foto3")) {
        document.getElementById("foto3").height = "100px";
        document.getElementById("foto3").width = "100px";
      }
      if (document.getElementById("foto4")) {
        document.getElementById("foto4").height = "100px";
        document.getElementById("foto4").width = "100px";
      }
      if (document.getElementById("foto5")) {
        document.getElementById("foto5").height = "100px";
        document.getElementById("foto5").width = "100px";
      }
      if (document.getElementById("foto6")) {
        document.getElementById("foto6").height = "100px";
        document.getElementById("foto6").width = "100px";
      }
      if (document.getElementById("foto7")) {
        document.getElementById("foto7").height = "100px";
        document.getElementById("foto7").width = "100px";
      }
      if (document.getElementById("foto8")) {
        document.getElementById("foto8").height = "100px";
        document.getElementById("foto8").width = "100px";
      }
    }
  }

  render() {
    // Asigna el actual dato de altura y anchura
    const imgStyle = { height: "100px", width: "100px" };
    return (
      <div>
        <h2>Graella de Imagenes</h2>

        <img
          style={imgStyle}
          id="foto1"
          src="foto1.jpg"
          alt="foto1"
          onClick={this.funcionZoom()}
        />
        <img
          style={imgStyle}
          id="foto2"
          src="foto2.jpg"
          alt="foto2"
          onClick={this.funcionZoom()}
        />
        <img
          style={imgStyle}
          id="foto3"
          src="../../public/foto3.jpg"
          alt="foto3"
          onClick={this.funcionZoom()}
        />
        <img
          style={imgStyle}
          id="foto4"
          src="foto4.jpg"
          alt="foto4"
          onClick={this.funcionZoom()}
        />
        <img
          style={imgStyle}
          id="foto5"
          src="foto5.jpg"
          alt="foto5"
          onClick={this.funcionZoom()}
        />
        <img
          style={imgStyle}
          id="foto6"
          src="foto6.jpg"
          alt="foto6"
          onClick={this.funcionZoom()}
        />
        <img
          style={imgStyle}
          id="foto7"
          src="foto7.jpg"
          alt="foto7"
          onClick={this.funcionZoom()}
        />
        <img
          style={imgStyle}
          id="foto8"
          src="foto8.jpg"
          alt="foto8"
          onClick={this.funcionZoom()}
        />
      </div>
    );
  }
}
export default Graella;
